import React from 'react'; 
import { Link } from 'react-router-dom'; 
import facebook from './facebook.svg';
import instagram from './instagram.svg';
import linkedin from './linkedin.svg';


const Navbar = ({ balance }) => { 
    return ( 
        <nav className="navbar shadow-sm p-3 mb-5 bg-light rounded"> 
            <div className="container"> 
                <ul className="nav justify-content-end">
                    <li className="nav-item">
                        <Link className="navbar-brand" to="/Welcomepage">Home</Link> 
                    </li>
                    <li className="nav-item">
                        <Link className="navbar-brand" to="/">Home</Link> 
                    </li>
                    <li className="nav-item">
                        <Link className="navbar-brand" to="/transactionForm">Transaction</Link>
                    </li>
                    <li className="nav-item">
                        <Link className="navbar-brand" to="/login">Log in</Link>
                    </li>
                    <li className="nav-item">
                    <img src={facebook} className="facebook" alt="facebook"/>
                    </li>
                    <li className="nav-item">
                    <img src={instagram} className="instagram" alt="instagram"/>
                    </li>
                    <li className="nav-item">
                    <img src={linkedin} className="linkedin" alt="linkedin"/>
                    </li>
                </ul>
            </div>  
        </nav> 
        
    ); 
}; 

export default Navbar;
